import React from 'react'
import { Link, useLocation } from 'react-router-dom'

const SideNav = () => {

    const location = useLocation().pathname;

    return (
        <div class="col-lg-3">
            <h1 class="my-4">Articles</h1>
            <div class="list-group">
                <Link to='/' class="list-group-item active">Recent</Link>
                <Link to='/' class="list-group-item">Major</Link>
                <Link to='/' class="list-group-item">Dream</Link>
            </div>
        </div>
    )
}
export default SideNav;
